(107, 1, '2020-07-31 13:06:21', '2020-07-31 13:06:21', 'New company aims to create better workplaces by putting employees in others\' shoes. Using virtual reality, a company called Live in Their World allows users to experience workplace scenarios in which bias, inequity, and incivility arise. In the wake of new Black Lives Matter protests, one company hopes to use virtual reality to help people better understand others by putting them in their colleagues’ shoes. The aim is to create better workplaces by helping employees develop and practice more respectful ways of interacting with each other.', 'A Virtual Reality Simulator', '', 'trash', 'closed', 'closed', '', 'a-virtual-reality-bias-simulator__trashed', '', '', '2020-08-04 07:06:22', '2020-08-04 07:06:22', '', 0, 'https://computaid.com/computaid-new-wordpress/?post_type=articles&#038;p=107', 0, 'articles', '', 0),
