(109, 1, '2020-07-31 13:11:52', '2020-07-31 13:11:52', 'What really happens when your data is stored on far-off servers in distant data centers. We live in a world that’s awash in information. Way back in 2011, an IBM study estimated that nearly 3 quintillion—that’s a 3 with 18 zeros after it—bytes of data were being generated every single day. We’re well past that mark now, given the doubling in the number of Internet users since 2011, the powerful rise of social media and machine learning, and the explosive growth in mobile computing, streaming services, and Internet of Things devices. Indeed, according to the latest Cisco Global Cloud Index, some 220,000 quintillion bytes—or if you prefer, 220 zettabytes—were generated “by all people, machines, and things” in 2016, on track to reach nearly 850 ZB in 2021.\r\n\r\nMuch of that data is considered ephemeral, and so it isn’t stored. But even a tiny fraction of a huge number can still be impressively large. When it comes to data, Cisco estimates that 1.8 ZB was stored in 2016, a volume that will quadruple to 7.2 ZB in 2021.', 'A View to the Cloud', '', 'trash', 'closed', 'closed', '', 'a-view-to-the-cloud__trashed', '', '', '2020-08-04 07:06:22', '2020-08-04 07:06:22', '', 0, 'https://computaid.com/computaid-new-wordpress/?post_type=articles&#038;p=109', 0, 'articles', '', 0),
(110, 1, '2020-07-31 13:10:57', '2020-07-31 13:10:57', '', 'MzEwMjY4NQ', '', 'inherit', 'open', 'closed', '', 'mzewmjy4nq', '', '', '2020-07-31 13:10:57', '2020-07-31 13:10:57', '', 109, 'https://computaid.com/computaid-new-wordpress/wp-content/uploads/2020/07/MzEwMjY4NQ.png', 0, 'attachment', 'image/png', 0),
(111, 1, '2020-07-31 13:15:41', '2020-07-31 13:15:41', 'San Diego Installs Smart Streetlights to Monitor the Metropolis. Sensor-laden streetlights will spot parking spaces, listen for gunshots, and track air pollution. None of the people walking around San Diego’s East Village neighborhood one recent afternoon were looking up at the streetlights (except me). And if they had, they likely wouldn’t have noticed that some of these lights were a little thicker around the middle than others, or that some lanterns topping old-style lampposts had a clear glass panel here and there.\r\n\r\nBut unbeknownst to the people below, those streetlights were looking—and listening—all around them, while also monitoring temperature, humidity, and other characteristics of the air.', 'Smart Streetlights to Monitor', '', 'trash', 'closed', 'closed', '', 'smart-streetlights-to-monitor__trashed', '', '', '2020-08-04 07:06:22', '2020-08-04 07:06:22', '', 0, 'https://computaid.com/computaid-new-wordpress/?post_type=articles&#038;p=111', 0, 'articles', '', 0),
